,"b","Size","Class","CLASS1","CLASS2","ASSOC1","Signif_Avg","Pivot_E","Flux1000","EFlux100","PL_FluxD","PL_Index","LP_FluxD","LP_Index","LP_beta","LP_SigCurv","LP_EPeak","Var_Index","Flags"]],["table_row2_labels_active",["Name","ra","dec","Size","Class","CLASS1","CLASS2","ASSOC1","Signif","Pivot_E","Flux1000","EFlux100","PL_FluxD","PL_Index","LP_FluxD","LP_Index","LP_beta","LP_SigCurv","LP_EPeak","Var_Index","Flags"]],["table_row3_labels",["Signif","F1","F2","F3","F4","F5","F6","F7","F8","HR1","HR2","HR3"]],["table_row3_labels_active",[]],["non_features",["Name","ra","dec","ASSOC1","Class","CLASS1","CLASS2","Flags"]],["features",["l","b","Signif","Pivot_E","Size","Flux1000","EFlux100","F1","F2","F3","F4","F5","F6","F7","F8","HR1","HR2","HR3","PL_FluxD","PL_Index","LP_FluxD","LP_Index","LP_beta","LP_SigCurv","LP_EPeak","Var_Index"]],["title_text","GClass: Visualization tool for the &lt;a href=\"https://fermi.gsfc.nasa.gov/ssc/data/access/lat/14yr_catalog/\"&gt; 4FGL-DR4&lt;/a&gt; catalog of Fermi LAT gamma-ray sources."],["cite_text","&lt;a href=\"https://heasarc.gsfc.nasa.gov/W3Browse/fermi/fermilpsc.html\"&gt;LAT 14-year Source Catalog (4FGL-DR4)&lt;/a&gt; Release gll_psc_v33.fit is used to make this visualization tool."],["ackn_text","This work was supported by NASA Chandra Awards AR3-14017X, AR9-20005A, and AR0-21007X and by NASA ADAP award 80NSSC19K0576."],["description_text",""],["download_text","&lt;a href=\"./GCLASS.csv\" download&gt;Download Full Dataset&lt;/a&gt;"],["contact_text","&lt;a href = \"mailto: huiyang@gwmail.gwu.edu\" target=\"_blank\"&gt;Contact&lt;/a&gt;"],["readme_text","\n\nThis website was built with the Python Bokeh and Panel libraries.\n\nThe user can:\n\u2022 Select visible classes\n\u2022 Select features used for each axis\n\u2022 Invert and apply log scale to axes with checkboxes to the right of the figure\n\nFeatures/parameters are extracted from the Fermi LAT 14-Year Point Source Catalog (4FGL-DR4).  \nPlease look up at Table 6 from &lt;a href=\"https://arxiv.org/abs/2201.11184\" target=\"_blank\"&gt;4FGL-DR3 paper&lt;/a&gt; as well as &lt;a href=\"https://heasarc.gsfc.nasa.gov/W3Browse/fermi/fermilpsc.html\"&gt;this website&lt;/a&gt; for details. \nThe revised (shortened) names used in this tool are shown below with thier original names. Otherwise the same names are used. \n\n    Name - Source_Name\n    ra   - RAJ2000\n    dec  - DEJ2000\n    l    - GLON\n    b    - GLAT\n    Signif   - Signif_Avg\n    Size     -  Conf_95_SemiMajor\n    Pivot_E  - Pivot_Energy\n    EFlux100 - Energy_Flux100\n    PL_FluxD - PL_Flux_Density\n    LP_FluxD - LP_Flux_Density\n    Var_Index - Variability_Index\n\n    F1,F2,F3,F4,F5,F6,F7,F8 are the spectral energy fluxes of each spectral band from nuFnu_Band\n    F1 (0.05-0.1 GeV, erg/cm^2/s)\n    F2 (0.1-0.3 GeV, erg/cm^2/s)\n    F3 (0.3-1 GeV, erg/cm^2/s)\n    F4 (1-3 GeV, erg/cm^2/s)\n    F5 (3-10 GeV, erg/cm^2/s)\n    F6 (10-30 GeV, erg/cm^2/s)\n    F7 (30-100 GeV, erg/cm^2/s)\n    F8 (100-1000 GeV, erg/cm^2/s)\n\n    HR1, HR2, HR3 are the hardness ratios based on F1-F8 defined below:\n    HR1 = (F3-F1-F2)/(F3+F1+F2)\n    HR2 = (F7+F6+F5-F4)/(F7+F6+F5+F4)\n    HR3 = (F6+F5+F4-F2-F3)/(F6+F5+F4+F2+F3)\n\n    \nClass labels are based on the CLASS1 column from 4FGL-DR4 catalog. We combined both the identified classes (with upper-case CLASS1 column) and the associated classes (with lower-case CLASS1 column) into the same classes. \nUsers should be cautious that the associated classes are given  based solely on the spatial coincidence, where the further identification needs to be done (e.g., pulsations, correlated variability, or correlated angular sizes with observations at other wavelengths).\nPlease look up at Table 5 from &lt;a href=\"https://arxiv.org/abs/2201.11184\" target=\"_blank\"&gt;4FGL-DR3 paper&lt;/a&gt; for source class details. \n\n\nBokeh plot tools in the toolbar to the top right of the figure allows additional interactivity: \n\u2022 Pan tool: click p","entries":[["Unassc","Unassc"],["GAL","GAL"],["AGN","AGN"],["SBG","SBG"],["SSRQ","SSRQ"],["NOV","NOV"],["MSP","MSP"],["LMB","LMB"],["PWN","PWN"],["unk","unk"],["SEY","SEY"],["BIN","BIN"],["SPP","SPP"],["FSRQ","FSRQ"],["BLL","BLL"],["GC","GC"],["RDG","RDG"],["HMB","HMB"],["BCU","BCU"],["CSS","CSS"],["SFR","SFR"],["GLC","GLC"],["PSR","PSR"],["SNR","SNR"],["NLSY1","NLSY1"]]}],["ini_visible_classes",["PSR","BLL","FSRQ","MSP"]],["table_row1_labels",[]],["table_row1_labels_active",[]],["table_row2_labels",["Name","ra","dec","l","b","Size","Class","CLASS1","CLASS2","ASSOC1","Signif_Avg","Pivot_E","Flux1000","EFlux100","PL_FluxD","PL_Index","LP_FluxD","LP_Index","LP_beta","LP_SigCurv","LP_EPeak","Var_Index","Flags"]],["table_row2_labels_active",["Name","ra","dec","Size","Class","CLASS1","CLASS2","ASSOC1","Signif","Pivot_E","Flux1000","EFlux100","PL_FluxD","PL_Index","LP_FluxD","LP_Index","LP_beta","LP_SigCurv","LP_EPeak","Var_Index","Flags"]],["table_row3_labels",["Signif","F1","F2","F3","F4","F5","F6","F7","F8","HR1","HR2","HR3"]],["table_row3_labels_active",[]],["non_features",["Name","ra","dec","ASSOC1","Class","CLASS1","CLASS2","Flags"]],["features",["l","b","Signif","Pivot_E","Size","Flux1000","EFlux100","F1","F2","F3","F4","F5","F6","F7","F8","HR1","HR2","HR3","PL_FluxD","PL_Index","LP_FluxD","LP_Index","LP_beta","LP_SigCurv","LP_EPeak","Var_Index"]],["title_text","GClass: Visualization tool for the &lt;a href=\"https://fermi.gsfc.nasa.gov/ssc/data/access/lat/14yr_catalog/\"&gt; 4FGL-DR4&lt;/a&gt; catalog of Fermi LAT gamma-ray sources."],["cite_text","&lt;a href=\"https://heasarc.gsfc.nasa.gov/W3Browse/fermi/fermilpsc.html\"&gt;LAT 14-year Source Catalog (4FGL-DR4)&lt;/a&gt; Release gll_psc_v33.fit is used to make this visualization tool."],["ackn_text","This work was supported by NASA Chandra Awards AR3-14017X, AR9-20005A, and AR0-21007X and by NASA ADAP award 80NSSC19K0576."],["description_text",""],["download_text","&lt;a href=\"./GCLASS.csv\" download&gt;Download Full Dataset&lt;/a&gt;"],["contact_text","&lt;a href = \"mailto: huiyang@gwmail.gwu.edu\" target=\"_blank\"&gt;Contact&lt;/a&gt;"],["readme_text","\n\nThis website was built with the Python Bokeh and Panel libraries.\n\nThe user can:\n\u2022 Select visible classes\n\u2022 Select features used for each axis\n\u2022 Invert and apply log scale to axes with checkboxes to the right of the figure\n\nFeatures/parameters are extracted from the Fermi LAT 14-Year Point Source Catalog (4FGL-DR4).  \nPlease look up at Table 6 from &lt;a href=\"https://arxiv.org/abs/2201.11184\" target=\"_blank\"&gt;4FGL-DR3 paper&lt;/a&gt; as well as &lt;a href=\"https://heasarc.gsfc.nasa.gov/W3Browse/fermi/fermilpsc.html\"&gt;this website&lt;/a&gt; for details. \nThe revised (shortened) names used in this tool are shown below with thier original names. Otherwise the same names are used. \n\n    Name - Source_Name\n    ra   - RAJ2000\n    dec  - DEJ2000\n    l    - GLON\n    b    - GLAT\n    Signif   - Signif_Avg\n    Size     -  Conf_95_SemiMajor\n    Pivot_E  - Pivot_Energy\n    EFlux100 - Energy_Flux100\n    PL_FluxD - PL_Flux_Density\n    LP_FluxD - LP_Flux_Density\n    Var_Index - Variability_Index\n\n    F1,F2,F3,F4,F5,F6,F7,F8 are the spectral energy fluxes of each spectral band from nuFnu_Band\n    F1 (0.05-0.1 GeV, erg/cm^2/s)\n    F2 (0.1-0.3 GeV, erg/cm^2/s)\n    F3 (0.3-1 GeV, erg/cm^2/s)\n    F4 (1-3 GeV, erg/cm^2/s)\n    F5 (3-10 GeV, erg/cm^2/s)\n    F6 (10-30 GeV, erg/cm^2/s)\n    F7 (30-100 GeV, erg/cm^2/s)\n    F8 (100-1000 GeV, erg/cm^2/s)\n\n    HR1, HR2, HR3 are the hardness ratios based on F1-F8 defined below:\n    HR1 = (F3-F1-F2)/(F3+F1+F2)\n    HR2 = (F7+F6+F5-F4)/(F7+F6+F5+F4)\n    HR3 = (F6+F5+F4-F2-F3)/(F6+F5+F4+F2+F3)\n\n    \nClass labels are based on the CLASS1 column from 4FGL-DR4 catalog. We combined both the identified classes (with upper-case CLASS1 column) and the associated classes (with lower-case CLASS1 column) into the same classes. \nUsers should be cautious that the associated classes are given  based solely on the spatial coincidence, where the further identification needs to be done (e.g., pulsations, correlated variability, or correlated angular sizes with observations at other wavelengths).\nPlease look up at Table 5 from &lt;a href=\"https://arxiv.org/abs/2201.11184\" target=\"_blank\"&gt;4FGL-DR3 paper&lt;/a&gt; for source class details. \n\n\nBokeh plot tools in the toolbar to the top right of the figure allows additional interactivity: \n\u2022 Pan tool: click and drag to pan the figure\n\u2022 Wheel zoom tool: Zoom and rescale the figure itself, as well as the axes\n\u2022 Tap tool: select a single source by clicking, which displays a table of properties for that source to the right\n\u2022 Lasso tool: Select multiple sources, which then remains selected for any combination of features plotted, and can be viewed in the table below the plot\n\u2022 Download tool: download the figure as a png\n\u2022 Reset tool: reset figure axis ranges\n\nThe table button below the figure opens an interactive table, which has these features:\n\n\u2022 Selectable columns\n\u2022 Sorting for each column\n\u2022 Interactive AladinLite (https://aladin.cds.unistra.fr/AladinLite/) and ESASky (https://sky.esa.int/esasky/) windows, displaying images at the coordinates of each source in user selectable surveys\n\u2022 Exporting the dataset to csv, Excel, or PDF formats\n\nThe user can also upload a csv file with custom objects to plot. See the upload help text for instructions.\n\n\n"],["html_title","GClass"],["get_ref_link_js","\n\n    function get_ref_link(ref) {\n    \n        return [ref, ref]\n    \n    }\n"],["format_js"," \n\n    function format(d, shadowroot) {\n            \n        var i = Number(d.DT_RowId.slice(2))\n        \n        var name_csc = table_source.data['Name'][i]\n        \n        var div_id = `\"aladin-lite-div` + name_csc.replace(/[^A-Z0-9]+/ig, \"_\") + `\"`\n\n        var aladin_div = '&lt;div id=' + div_id + ' style=\"width:400px;height:400px;\"&gt;&lt;/div&gt;'\n        \n        var aladin_script = 'var aladin = A.aladin(document.querySelector(\"div\").children[0].shadowRoot.querySelector(\"div.bk-Column\").shadowRoot.querySelector(\"div:nth-child(23)\").shadowRoot.querySelector(\"div.bk-Div\").shadowRoot.querySelector(\"#' + div_id.slice(1) + '), {survey: \"P/2MASS/color\", fov:0.05, cooFrame:\"ICRSd\", target: \"' + table_source.data['ra'][i] + ', ' + table_source.data['dec'][i] + '\"});'\n        \n        var esa_sky = 'https://sky.esa.int/?target=' + table_source.data['ra'][i] + '%20' + table_source.data['dec'][i] + \n            '&amp;hips=DSS2+color&amp;fov=0.05&amp;cooframe=J2000d&amp;sci=false&amp;lang=en&amp;hide_welcome=true&amp;hide_banner_info=true'\n            \n        var iframe = '&lt;iframe alt=\"\" border=\"0\" bordercolor=\"#000000\" frameborder=\"0\" height=\"\" hspace=\"0\" ' +\n            'scrolling=\"auto\" ' +\n            'src=\"' + esa_sky + '\" title=\"\" vspace=\"0\" width=\"400px\" ' +\n            'class=\"\" style=\"height: 400px;\"&gt;' +\n            'https://sky.esa.int?hide_welcome=true&amp;amp;&amp;amp;hide_banner_info=true.' +\n            '&lt;/iframe&gt;'   \n\n        return [aladin_div, aladin_script, iframe];\n    }\n"],["derived_func_js",""],["derived_func_py",""],["special_plot",{"type":"map"}],["upload_help_text","\n\nThe user can dowload the full dataset using the link above which includes all sources from 4FGL-DR4.\nThen you can make a selection of objects to make a new csv file and plot them by using the Choose File button below.  \n\n"],["use_raw_cols_list",["Source_Name","RAJ2000","DEJ2000","GLON","GLAT","Class","CLASS1","CLASS2","ASSOC1","Signif_Avg","Pivot_Energy","Conf_95_SemiMajor","Flux1000","Energy_Flux100","F1","F2","F3","F4","F5","F6","F7","F8","HR1","HR2","HR3","PL_Flux_Density","PL_Index","LP_Flux_Density","LP_Index","LP_beta","LP_SigCurv","LP_EPeak","Variability_Index","Flags"]],["all",{"type           s = !s;\n                } \n                else if (',' == l &amp;&amp; s) \n                    l = row[++i] = '';\n                else if ('\\n' == l &amp;&amp; s) {\n                    if ('\\r' == p) row[i] = row[i].slice(0, -1);\n                    row = ret[++r] = [l = '']; \n                    i = 0;\n                } \n                else row[i] += l;\n                p = l;\n            }\n            return ret;\n        }\n        \n        let obj = csvToArray(atob(this.value).trim())\n\n        let len = obj.length - 1\n\n        //transpose\n        obj = obj[0].map((col, i) =&gt; obj.map(([...row]) =&gt; row[i]))\n\n        let df_custom = {}\n        \n        // !!!\n        \n        for (var ob of obj) {\n        \n            let name = ob[0]\n        \n            if (!(name in all_dict)) {\n            \n                if (name in q['all']) \n                        \n                    name = q['all'][name]['label'] \n                                      \n                else continue\n                                        \n            } \n\n            let sl = ob.slice(1)\n            \n            if (name in all_dict)             \n                if (all_dict[name]['format'].match(/to/) != null)\n                    sl = sl.map(parseFloat)\n\n            df_custom[name] = sl    \n        }\n        \n            \n        function replace_from_dict(arr, dic) {\n\n            var out = [];\n            \n            for (var i=0; i&lt;arr.length; i++) {\n            \n                 var cl = arr[i];\n                 \n                 if (cl in dic)                \n                     out.push(dic[cl])\n                 else    \n                     out.push(cl)\n                       \n            }\n            \n            return out\n            \n         }   \n         \n         df_custom[q['class_column']] = replace_from_dict(df_custom[q['class_column']], q['classes_dict']) \n \n\n        \n\n        var feat_x = features[sel_x.active]\n        var feat_y = features[sel_y.active]\n\n        if (log_source.data[feat_x][0] == 1) {\n        \n            if (['P_intra', 'P_inter'].includes(feat_x))         \n                df_custom['x'] = df_custom[feat_x].map(x =&gt; Math.log10(1/(1.001 - x)))   \n            else\n                df_custom['x'] = df_custom[feat_x].map(x =&gt; Math.log10(x)) \n            \n        } else { \n            if (['P_intra', 'P_inter'].includes(feat_x))         \n                df_custom['x'] = df_custom[feat_x].map(x =&gt; 1/(1.001 - x))   \n            else\n                df_custom['x'] = df_custom[feat_x]\n        }         \n \n        if (log_source.data[feat_y][0] == 1) {\n        \n            if (['P_intra', 'P_inter'].includes(feat_y))         \n                df_custom['y'] = df_custom[feat_y].map(x =&gt; Math.log10(1/(1.001 - x)))   \n            else\n                df_custom['y'] = df_custom[feat_y].map(x =&gt; Math.log10(x)) \n            \n        } else { \n            if (['P_intra', 'P_inter'].includes(feat_y))         \n                df_custom['y'] = df_custom[feat_y].map(x =&gt; 1/(1.001 - x))   \n            else\n                df_custom['y'] = df_custom[feat_y]\n        }         \n        \n        df_custom['color'] = []\n\n        for (var x of df_custom[class_column]) {\n\n            if (colors_dict[x])\n                df_custom['color'].push(colors_dict[x])\n            else    \n                df_custom['color'].push('black')\n         }       \n\n        df_custom['line_color'] = Array(len).fill('black')\n        df_custom['size'] = Array(len).fill(15)\n\n        var r = {}\n\n        for (const [k, v] of Object.entries(df_custom)) { \n\n            var b = df_custom[k]\n\n            var c = new Array()            \n            for (var i of b)\n                c.push(i)   \n\n            r[k] = c\n\n        }  \n\n        sources['custom'].data = r    \n\n        sources['custom'].change.emit() \n\n        //obj = Object.entries(obj)    \n        //let obj_dict = Object.assign({}, ...obj.map((x) =&gt; ({[x[0]]: x[1:]}))) \n        //const obj2 = Object.fromEntries(obj[:,0].map((key, index)=&gt; [key, obj[index, 1:]))\n\n    "}},{"id":"p8379"},{"id":"p8388"}]]]},"width":200,"accept":".csv"}},{"id":"p8356"},{"type":"object","name":"Div","id":"p8349","attributes":{"text":"\n\n        \n    &lt;style&gt;\n        body {font-family: Arial, Helvetica, sans-serif;}\n\n        /* The Modal (background) */\n        .modal {\n          display: none; /* Hidden by default */\n          position: fixed; /* Stay in place */\n          z-index: 1; /* Sit on top */\n          padding-top: 50px; /* Location of the box */\n          padding-bottom: 50px;\n          left: 400px;\n          top: 0;\n          width: 50%; /* Full width */\n          height: 100%; /* Full height */\n          overflow: auto; /* Enable scroll if needed */\n          background-color: rgb(0,0,0); /* Fallback color */\n          background-color: rgba(0,0,0,0.4); /* Black w/ opacity */\n        }\n\n        /* Modal Content */\n        .modal-content {\n          background-color: #fefefe;\n          margin: auto;\n          padding: 20px;\n          border: 1px solid #888;\n          width: 80%;\n          white-space: pre-wrap;\n        }    \n    &lt;/style&gt;\n    \n\n        &lt;div id=\"readme\" class=\"modal\", style=\"display: none;\"&gt;\n\n            &lt;button onclick='document.querySelector(\"div\").children[0].shadowRoot.querySelector(\"div:nth-child(7)\").shadowRoot.querySelector(\"div:nth-child(8)\").shadowRoot.querySelector(\"div:nth-child(7)\").shadowRoot.querySelector(\"div:nth-child(19)\").shadowRoot.querySelector(\"#readme\").style.display=\"none\"'&gt;Close\n            &lt;/button&gt; \n\n            &lt;div class=\"modal-content\"&gt;\n\n                \n\nThis website was built with the Python Bokeh and Panel libraries.\n\nThe user can:\n\u2022 Select visible classes\n\u2022 Select features used for each axis\n\u2022 Invert and apply log scale to axes with checkboxes to the right of the figure\n\nFeatures/parameters are extracted from the Fermi LAT 14-Year Point Source Catalog (4FGL-DR4).  \nPlease look up at Table 6 from &lt;a href=\"https://arxiv.org/abs/2201.11184\" target=\"_blank\"&gt;4FGL-DR3 paper&lt;/a&gt; as well as &lt;a href=\"https://heasarc.gsfc.nasa.gov/W3Browse/fermi/fermilpsc.html\"&gt;this website&lt;/a&gt; for details. \nThe revised (shortened) names used in this tool are shown below with thier original names. Otherwise the same names are used. \n\n    Name - Source_Name\n    ra   - RAJ2000\n    dec  - DEJ2000\n    l    - GLON\n    b    - GLAT\n    Signif   - Signif_Avg\n    Size     -  Conf_95_SemiMajor\n    Pivot_E  - Pivot_Energy\n    EFlux100 - Energy_Flux100\n    PL_FluxD - PL_Flux_Density\n    LP_FluxD - LP_Flux_Density\n    Var_Index - Variability_Index\n\n    F1,F2,F3,F4,F5,F6,F7,F8 are the spectral energy fluxes of each spectral band from nuFnu_Band\n    F1 (0.05-0.1 GeV, erg/cm^2/s)\n    F2 (0.1-0.3 GeV, erg/cm^2/s)\n    F3 (0.3-1 GeV, erg/cm^2/s)\n    F4 (1-3 GeV, erg/cm^2/s)\n    F5 (3-10 GeV, erg/cm^2/s)\n    F6 (10-30 GeV, erg/cm^2/s)\n    F7 (30-100 GeV, erg/cm^2/s)\n    F8 (100-1000 GeV, erg/cm^2/s)\n\n    HR1, HR2, HR3 are the hardness ratios based on F1-F8 defined below:\n    HR1 = (F3-F1-F2)/(F3+F1+F2)\n    HR2 = (F7+F6+F5-F4)/(F7+F6+F5+F4)\n    HR3 = (F6+F5+F4-F2-F3)/(F6+F5+F4+F2+F3)\n\n    \nClass labels are based on the CLASS1 column from 4FGL-DR4 catalog. We combined both the identified classes (with upper-case CLASS1 column) and the associated classes (with lower-case CLASS1 column) into the same classes. \nUsers should be cautious that the associated classes are given  based solely on the spatial coincidence, where the further identification needs to be done (e.g., pulsations, correlated variability, or correlated angular sizes with observations at other wavelengths).\nPlease look up at Table 5 from &lt;a href=\"https://arxiv.org/abs/2201.11184\" target=\"_blank\"&gt;4FGL-DR3 paper&lt;/a&gt; for source class details. \n\n\nBokeh plot tools in the toolbar to the top right of the figure allows additional interactivity: \n\u2022 Pan tool: click and drag to pan the figure\n\u2022 Wheel zoom tool: Zoom and rescale the figure itself, as well as the axes\n\u2022 Tap tool: select a single source by clicking, which displays a table of properties for that source to the right\n\u2022 Lasso tool: Select multiple sources, which then remains selected for any combination of features plotted, and can be viewed in the table below the plot\n\u2022 Download tool: download the figure as a png\n\u2022 Reset tool: reset figure axis ranges\n\nThe table button below the figure opens an interactive table, which has these features:\n\n\u2022 Selectable columns\n\u2022 Sorting for each column\n\u2022 Interactive AladinLite (https://aladin.cds.unistra.fr/AladinLite/) and ESASky (https://sky.esa.int/esasky/) windows, displaying images at the coordinates of each source in user selectable surveys\n\u2022 Exporting the dataset to csv, Excel, or PDF formats\n\nThe user can also upload a csv file with custom objects to plot. See the upload help text for instructions.\n\n\n\n\n            &lt;/div&gt;        \n\n        &lt;/div&gt;  \n\n        "}},{"type":"object","name":"Div","id":"p8352","attributes":{"text":"\n\n        \n    &lt;style&gt;\n        body {font-family: Arial, Helvetica, sans-serif;}\n\n        /* The Modal (background) */\n        .modal {\n          display: none; /* Hidden by default */\n          position: fixed; /* Stay in place */\n          z-index: 1; /* Sit on top */\n          padding-top: 50px; /* Location of the box */\n          padding-bottom: 50px;\n          left: 400px;\n          top: 0;\n          width: 50%; /* Full width */\n          height: 100%; /* Full height */\n          overflow: auto; /* Enable scroll if needed */\n          background-color: rgb(0,0,0); /* Fallback color */\n          background-color: rgba(0,0,0,0.4); /* Black w/ opacity */\n        }\n\n        /* Modal Content */\n        .modal-content {\n          background-color: #fefefe;\n          margin: auto;\n          padding: 20px;\n          border: 1px solid #888;\n          width: 80%;\n          white-space: pre-wrap;\n        }    \n    &lt;/style&gt;\n    \n\n        &lt;div id=\"upload_help\" class=\"modal\", style=\"display: none;\"&gt;\n\n            &lt;button onclick='document.querySelector(\"div\").children[0].shadowRoot.querySelector(\"div:nth-child(7)\").shadowRoot.querySelector(\"div:nth-child(8)\").shadowRoot.querySelector(\"div:nth-child(7)\").shadowRoot.querySelector(\"div:nth-child(20)\").shadowRoot.querySelector(\"#upload_help\").style.display=\"none\"'&gt;Close\n            &lt;/button&gt; \n\n            &lt;div class=\"modal-content\"&gt;\n\n                \n\nThe user can dowload the full dataset using the link above which includes all sources from 4FGL-DR4.\nThen you can make a selection of objects to make a new csv file and plot them by using the Choose File button below.  \n\n\n\n            &lt;/div&gt;        \n\n        &lt;/div&gt;  \n\n    "}},{"type":"object","name":"Div","id":"p8355","attributes":{"text":"\n\n        \n    &lt;style&gt;\n        body {font-family: Arial, Helvetica, sans-serif;}\n\n        /* The Modal (background) */\n        .modal {\n          display: none; /* Hidden by default */\n          position: fixed; /* Stay in place */\n          z-index: 1; /* Sit on top */\n          padding-top: 50px; /* Location of the box */\n          padding-bottom: 50px;\n          left: 400px;\n          top: 0;\n          width: 50%; /* Full width */\n          height: 100%; /* Full height */\n          overflow: auto; /* Enable scroll if needed */\n          background-color: rgb(0,0,0); /* Fallback color */\n          background-color: rgba(0,0,0,0.4); /* Black w/ opacity */\n        } /div&gt;\n        &lt;/div&gt;  \n\n    "}},{"type":"object","name":"CheckboxGroup","id":"p8358","attributes":{"js_property_callbacks":{"type":"map","entries":[["change:active",[{"type":"object","name":"CustomJS","id":"p8359","attributes":{"args":{"type":"map","entries":[["p",{"id":"p8217"}]]},"code":" \n\n        if (cb_obj.active.length == 1) \n            p.visible = true        \n        else \n            p.visible = false\n\n    "}}]]]},"labels":["show file"],"active":[0]}}]}},{"type":"object","name":"Column","id":"p8398","attributes":{"children":[{"type":"object","name":"Spacer","id":"p8397","attributes":{"height":100}},{"type":"object","name":"Div","id":"p8332","attributes":{"margin":[0,0,0,0],"text":"&lt;div id=\"table\"&gt;&lt;/div&gt;"}}]}}]}},{"type":"object","name":"Row","id":"p8417","attributes":{"children":[{"type":"object","name":"Spacer","id":"p8399","attributes":{"width":80}},{"id":"p8245"}]}},{"type":"object","name":"Row","id":"p8418","attributes":{"children":[{"type":"object","name":"Spacer","id":"p8400","attributes":{"height":30}}]}},{"type":"object","name":"Row","id":"p8419","attributes":{"children":[{"type":"object","name":"Div","id":"p8344","attributes":{"width":1000,"text":"This work was supported by NASA Chandra Awards AR3-14017X, AR9-20005A, and AR0-21007X and by NASA ADAP award 80NSSC19K0576."}},{"type":"object","name":"Div","id":"p8347","attributes":{"text":"&lt;a href=\"https://hits.seeyoufarm.com\"&gt;&lt;img src=\"https://hits.seeyoufarm.com/api/count/incr/badge.svg?url=https%3A%2F%2Fhome.gwu.edu%2F%7Ekargaltsev%2FXCLASS%2F&amp;count_bg=%2379C83D&amp;title_bg=%23555555&amp;icon=&amp;icon_color=%23E7E7E7&amp;title=hits&amp;edge_flat=false\"/&gt;&lt;/a&gt;"}}]}},{"type":"object","name":"Row","id":"p8420","attributes":{"children":[{"type":"object","name":"Div","id":"p8346","attributes":{"text":"2023 v.5b7"}}]}},{"type":"object","name":"Row","id":"p8421","attributes":{"children":[{"type":"object","name":"Div","id":"p8345","attributes":{"t
